},"is_video":false,"accessibility_caption":"Photo shared by Lil BUB on March 18, 2021 tagging @waggleforpets. May be an image of 2 people, cat and indoor.","edge_media_to_caption":{"edges":[{"node":{"text":"We can never predict when our pets may require expensive emergency vet care. I experienced this with BUB when she broke her elbow, and now it's happened to poor Rockford pictured above, who barely managed to escape a house fire. Thankfully, our friends at Waggle provide an incredible crowdfunding service to help raise money for emergency pet care in a transparent way that ensures that all of the money raised goes directly to the pet's care.\n\nPlease consider contributing to Rockford's medical care at the link in our bio. \n\nAny funds donated in excess of the amount needed for his care get split between funding additional pets on Waggle and Lil BUB\u2019s Big FUND for Special Needs Pets. It's win/win/win situation. \n\n#lilbubsbigfund #waggle #lilbub #bestjobbub"}}]},"edge_media_to_comment":{"count":246},"comments_disabled":false,"taken_at_timestamp":1616092750,"edge_liked_by":{"count":48669},"edge_media_preview_like":{"count":48669},"location":null,"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/s640x640/162082132_895187887983533_4129890509983762820_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=Zf4Dal9npOQAX8W0abr\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=76e51f93487fb49df0448c69a64bb231\u0026oe=6094D4B3\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/s150x150/162082132_895187887983533_4129890509983762820_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=Zf4Dal9npOQAX8W0abr\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=cc851f155ae33ba28c7ab9d6ca96eeb5\u0026oe=60951B78\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/s24
